import React from 'react';
import { Router, Route, Switch } from 'react-router-dom';
import Login from './pages/Login';
import history from './history';
import './style/App.css';


const App = () => {
  return (
    <div className="ui container">
      <Router history={history}>
        <div>
          <Header />
          <Switch>
            <Route path="/" exact component={Dictionary} />
            <Route path="/login" exact component={Login} />
            <Route path="/profile" exact component={Profile} />
            <Route path="/repeat-vocabulary" exact component={RepeatVocabulary} />
            <Route path="/vocabulary" exact component={Vocabulary} />
            <Route path="/learn-word" exact component={LearnNewWord} />
            <Route path="/editor/:activePage" exact component={Editor} />
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
